description:
Verenigde Staten
Actie / Thriller
100 minuten

goed

met Nicolas Cage, Shahkrit Yamnarm en Charlie Yeung

Een professionele huurmoordenaar (Nicolas Cage) verblijft in Bangkok om een aantal klussen af te handelen. Maar dat blijkt 
lastiger dan gedacht, en hij ondervindt de nodige tegenwerking. Dan valt hij ook nog eens voor een lokale schoonheid en moet 
hij een van zijn weinige vertrouwelingen te vriend zien te houden.
